import React from 'react';
import './Article.css';
const Article = ({reading,onRouteChange}) => {
    return(
        <div className="center pa3 pa5-ns">
            <p className="br white fw6 f4 measure ">
                {reading}
                <br/>
                <button 
                    className='w-30 grow f4 link ph3 pv2 dib white bg-light-red' 
                    onClick={()=>onRouteChange('home')}
                    >Back</button>
            </p>
        </div>  
    );
}

export default Article;
